import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Particles from 'react-particles-js'

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}))

const particleOpt = {
  particles: {
    number: {
      value: 200,
      density: {
        enable: true,
        value_area: 1000
      },
      move: {
        enable: true,
        speed: 1
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["push"]
        }
    }
  }
}

function Index(props) {
    return (
      <div>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <div className="wrapper">
          <hgroup className="introduction">
            <h1 className="display-3 text-center hello">Hello, I'm <span>Maicon Esteves</span>.</h1>
            <h2 className="display-3 text-center hello">I'm a full-stack developer.</h2>
          </hgroup>
          <Button variant="outlined">Default</Button>
        </div>  
      </div>
    );
}

export default Index
